import React from 'react';

const NutritionComparison = (props) =>{
    console.log("NutritionComparison",props)
    return(
        <div className="nutrition-comparison">
            <p>See the the nutrient comparison below</p>
            {props.data?
                <div className="comparisons">
                    <NutritionList data={props.data.kibble}/>
                    <NutritionList data={props.data.recipe}/>
                </div>
            : null}
            <p>Learn about <a href="#">the role of protein, fat, and carbs</a> in a dog's diet.</p>
            <p>* All units above are given in grams per 1000 calories (g/kcal).</p>
        </div>
    )
}

const NutritionList = (props) =>{
    return(
        <div className="outside-dog-food">
            <p>{props.data.name}</p>
            <h2>Protein</h2>
            <p>{props.data.protein}</p>
            <h2>Fat</h2>
            <p>{props.data.fat}</p>
            <h2>Carbohydrate</h2>
            <p>{props.data.carbs}</p>
        </div>
    )
}

export default NutritionComparison;
